import React from "react";
import "./GifList.css";
import GifCard from "./GifCard";
const GifList = props => {
  const images = props.images.map(image => {
    return <GifCard gif={image} key={image.id} />;
  });
  return <div className="image-list">{images}</div>;
};

export default GifList;
